float* fcMkl(int column1,int row2,int r1c2,float* inputmat, float* weightmat, float* biasmat)
{



    float *inputmatrix, *weightmatrix, *biasmatrix;
    int i, j;



    inputmatrix = (float *)mkl_malloc( column1*r1c2*sizeof( float ), 64 );
    weightmatrix = (float *)mkl_malloc( r1c2*row2*sizeof( float ), 64 );
    biasmatrix = (float *)mkl_malloc( column1*row2*sizeof( float ), 64 );
    if (inputmatrix == NULL || weightmatrix == NULL || biasmatrix == NULL) {
      mkl_free(inputmatrix);
      mkl_free(weightmatrix);
      mkl_free(biasmatrix);
      return NULL;
    }

    for (i = 0; i < (r1c2); i++) {
        for (j = 0; j < (column1); j++) {
            inputmatrix[j*r1c2+i] = inputmat[i*column1 + j];
        }
    }

    for (i = 0; i < (row2); i++) {
        for (j = 0; j < (r1c2); j++) {
            weightmatrix[j*row2+i] = weightmat[i*r1c2 + j];
        }
    }

    for (i = 0; i < (row2); i++) {
        for (j = 0; j < (column1); j++) {
            biasmatrix[j*row2+i] = biasmat[i*column1 + j];
        }
    }

    cblas_sgemm(CblasRowMajor, CblasNoTrans, CblasNoTrans, column1, row2, r1c2, 1.0, inputmatrix, r1c2, weightmatrix, row2, 1.0, biasmatrix, row2);


    float* out;

    for (i = 0; i < (row2); i++) {
        for (j = 0; j < (column1); j++) {
            out[i*column1 + j] = biasmatrix[j*row2+i];
        }
    }

    mkl_free(inputmatrix);
    mkl_free(weightmatrix);
    mkl_free(biasmatrix);

    return out;

}

float* relu(int length,float* inputmat)
{
    float inputmatrix[length];

    int i;

    for (i = 0; i < length; ++i)
    {
        inputmatrix[i] = inputmat[i];
    }
    

    for (i = 0; i < length; ++i)
    {
        if (inputmatrix[i] < 0)
        {
            inputmatrix[i] = 0;
        }
    }

    float* out;

    for (i = 0; i < length; i++) {
        out[i] = inputmatrix[i];
    }

    return out;
}

float* softmax(int length,float* inputvec)
{


    vector<float> inputvector;
    float* out;

    int i, j;
    

    for (i = 0; i < length; ++i)
    {
        float a;
        a = inputvec[i];
        inputvector.push_back(a);
    }

    for (i = 0; i < length; ++i)
    {
        float a = exp(inputvector.at(i));
        float b = 0;
        for (j = 0; j < length; ++j)
        {
            b += exp(inputvector.at(j));
        }
        out[i] = a / b;
    }

    return out;
}


int audio(string inputmatrix, string outputmatrix)
{
    ifstream inMat(inputmatrix);
    float inputmtrx1[250];

    for (int i = 0; i < 250; i++)
    {
        inMat >> inputmtrx1[i];
    }

    float weightmat1[] = IP1_WT;
    float biasmat1[] = IP1_BIAS;

    float* inputmtrx2;

    inputmtrx2 = fcMkl(1,144,250,inputmtrx1, weightmat1, biasmat1);



    inputmtrx2 = relu(144,inputmtrx2);



    float weightmat2[] = IP2_WT;
    float biasmat2[] = IP2_BIAS;

    float* inputmtrx3;

    inputmtrx3 = fcMkl(1,144,144,inputmtrx2, weightmat2, biasmat2);



    inputmtrx3 = relu(144,inputmtrx3);



    float weightmat3[] = IP2_WT;
    float biasmat3[] = IP2_BIAS;

    float* inputmtrx4;

    inputmtrx4 = fcMkl(1,144,144,inputmtrx3, weightmat3, biasmat3);



    inputmtrx4 = relu(144,inputmtrx4);



    float weightmat4[] = IP2_WT;
    float biasmat4[] = IP2_BIAS;

    float* outMat;

    outMat = fcMkl(1,12,144,inputmtrx4, weightmat4, biasmat4);



    outMat = softmax(12,outMat);

    for (int i = 0; i < 12; i++)
    {
        cout << outMat[i] << endl;
    }
    
    return 0;

}



int main(int i, char **c)
{

    string help = "._HELP_\n"
                  "      Supported command type: \n"
                  "      --> ./yourcode.out audiosamplefile outputfile\n";

    if (i == 3)
    {
        string inputmatrix = c[1];
        string filetype = inputmatrix.substr(inputmatrix.length() - 4, inputmatrix.length() - 1);
        ifstream ifile;
        ifile.open(inputmatrix);
        if (filetype == ".txt" && ifile)
        {

            string outputmatrix = c[2];
            string filetype = outputmatrix.substr(outputmatrix.length() - 4, outputmatrix.length() - 1);
            if (filetype == ".txt")
            {
                audio(inputmatrix, outputmatrix);
            }
            else
            {
                cout << "ERROR: output file type not supported, .txt required: " << outputmatrix << endl;
                cout << help << endl;
            }


        }
        else if (filetype != ".txt" && ifile)
        {
            cout << "ERROR: input file type not supported, .txt required: " << inputmatrix << endl;
            cout << help << endl;
        }
        else
        {
            cout << "ERROR: file dose not exist: " << inputmatrix << endl;
            cout << help << endl;
        }
    }
    else
    {
        cout << "ERROR: bad input: " << endl;
        cout << help << endl;
    }

    return 0;
}
